import React from 'react';

const ClassRoutine = () => {
  const routine = [
    { period: '1st', subject: 'English', teacher: 'Ms. Smith', time: '8:00-8:45am' },
    { period: '2nd', subject: 'Math', teacher: 'Mr. Johnson', time: '8:45-9:30am' },
    { period: '3rd', subject: 'Science', teacher: 'Ms. Thompson', time: '9:30-10:15am' },
    // Add more periods here...
  ];

  return (
    <div className="routine">
      <h2>Class Routine</h2>
      <table>
        <thead>
          <tr>
            <th>Period</th>
            <th>Subject</th>
            <th>Teacher</th>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          {routine.map((period, index) => (
            <tr key={index}>
              <td>{period.period}</td>
              <td>{period.subject}</td>
              <td>{period.teacher}</td>
              <td>{period.time}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ClassRoutine;
